import React from "react";
import { Switch, Route } from "react-router-dom";
import HeaderFooter from "./components/HeaderFooter";
import "./App.css";
import userPage from "./pages/userPage";

function App() {
	return (
		<>
			<HeaderFooter />
			<Switch>
				<Route exact path="/userPage/:userId/" component={userPage} />
			</Switch>
		</>
	);
}

export default App;
